import axios from 'axios';
import { useState,useEffect } from "react";
const Posts = () => {

    const [post,setPost] = useState([]);

    useEffect(()=>{
        getPosts()
    }, [])
    const getPosts=()=>{  
        axios.get('https://jsonplaceholder.typicode.com/posts')
        .then((res) => {
        setPost(res.data);
        })
    }
    return(
        <div>
            <h1>API  DATA</h1>
            {
                post.map(post => (
                    <div key={post.id}>
                        <div><h5><b>Title : </b> {post.title}</h5></div>
                       <div> <p>
                            {post.body}
                        </p>  </div>
                    </div>
                ))
            }
        </div>   
    )
}
export default Posts;
